async function main() {

    let signer = new ethers.Wallet(`0x${process.env.AURORA_PRIVATE_KEY}`)
    const _provider = new ethers.providers.JsonRpcProvider("https://testnet.aurora.dev");
    const _signer = await signer.connect(_provider);

    const contract = new ethers.Contract(
        "0xe9326dF5e97Aa5c77Ae6af269F3683A942c4601D",
        ABI.abi,
        _signer
    );

    for(let i = 0; i < 16; i++) {
        let traitarr = [trait0, trait1, trait2, trait3, trait4, trait5, trait6, trait7];
        let txn = await contract.uploadTraits(7, i, traitarr[7][i]);
        let receipt = await txn.wait();
        console.log(receipt);
        console.log(i);
        console.log("wait for a second!");
        await sleep(10000)
    }
}

function sleep(ms) {
  return new Promise((resolve) => {
    setTimeout(resolve, ms);
  });
}
main();